      SELECT - COUNT ( * ) - + + 97 AS col0, + COALESCE ( COUNT ( * ), + 8 * 41 * + 6 + 24 / + 32 * - CAST ( + - 91 AS INTEGER ) * + 97 * NULLIF ( + 25, - 41 * 76 ) - - 83 ) * CAST ( NULL AS INTEGER ) AS col0;

outputs:
  - name: q2011.out
    data: |
      -98	NULL
